import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to render the profile section
    await page.getByText('Your Profile', { exact: true }).first().click();

    // Wait for the profile page content to be visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').innerText();
    const username = await page.locator('.profile-info .username').innerText();
    const bio = await page.locator('.profile-info .bio').innerText();

    // Extract profile stats
    const orders = await page.locator('.stat').filter({ hasText: 'Orders' }).locator('.stat-number').innerText();
    const reviews = await page.locator('.stat').filter({ hasText: 'Reviews' }).locator('.stat-number').innerText();
    const sellerRating = await page.locator('.stat').filter({ hasText: 'Seller Rating' }).locator('.stat-number').innerText();

    const extractedData = {
      fullName,
      username,
      bio,
      stats: {
        orders: parseInt(orders, 10),
        reviews: parseInt(reviews, 10),
        sellerRating: parseFloat(sellerRating)
      }
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
